import React from "react";
import LineChart from "../../components/ui/LineChart";
import DataTable from "../../components/ui/DataTable";

const values = [
  ["Month", ""],
  ["January", 500],
  ["February", 436],
  ["March", 846],
  ["April", 245],
  ["May", 500],
  ["June", 475],
  ["July", 500],
  ["August", 500],
  ["September", 500],
  ["October", 1250],
  ["November", 1250],
  ["December", 1250],
];

const accvalues = [
  { id: 1, name: "Johny Bravo", username: "OhMama", email: "johny@gmail.com", date: "28 Jan, 12:30 AM", status: "Active" },
  { id: 2, name: "Johny Maskulado", username: "OhMuscle", email: "masku@gmail.com", date: "25 Jan, 10:40 PM", status: "Active" },
  { id: 3, name: "Abdul Jakol", username: "Alahooooo!", email: "abdul@gmail.com", date: "20 Jan, 10:40 PM", status: "Disabled" },
  { id: 4, name: "Wilson Smith", username: "Lalalala", email: "wsmith@gmail.com", date: "15 Jan, 03:29 PM", status: "Disabled" },
  { id: 5, name: "Emilly Sing", username: "Yeaaaahh!", email: "ESing@gmail.com", date: "14 Jan, 10:40 PM", status: "Active" },
  { id: 6, name: "Oneal Bravo", username: "OhMama", email: "johny@gmail.com", date: "28 Jan, 12:30 AM", status: "Active" },
  { id: 7, name: "Johny Maskulado", username: "OhMuscle", email: "masku@gmail.com", date: "25 Jan, 10:40 PM", status: "Active" },
  { id: 8, name: "Shane Jakol", username: "Alahooooo!", email: "abdul@gmail.com", date: "20 Jan, 10:40 PM", status: "Disabled" },
  { id: 9, name: "Wilson Smith", username: "Lalalala", email: "wsmith@gmail.com", date: "15 Jan, 03:29 PM", status: "Disabled" },
  { id: 10, name: "Emilly Sing", username: "Yeaaaahh!", email: "ESing@gmail.com", date: "14 Jan, 10:40 PM", status: "Active" },
];

const title = "Recent";
const htitle = "Months";
const vtitle = "Admin Accounts";

export const AdminManagement = ({ theme }) => {
  return (
    <div className={`col-span-8 overflow-hidden rounded-lg text-xs md:text-md w-64 px-8 sm:w-full`}>
      <div className="pt-4">
        {/* Line chart */}
        <LineChart values={values} title={title} htitle={htitle} vtitle={vtitle} />

        {/* Admin Accounts Title and Add Account Button */}
        <div className="flex justify-between items-center mt-4 sm:mt-6 lg:mt-8">
          <h1 className="text-2xl font-semibold">Admin Accounts</h1>
          <button className="bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4 rounded">
            + Add Account
          </button>
        </div>

        {/* DataTable */}
        <DataTable accvalues={accvalues} />
      </div>
    </div>
  );
};
